import React from 'react';
import cart from '../assets/img/empty-cart.png'

function Cart(props) {
    return (
        <div className="cart">
                    <img className="cart__empty" src={cart} alt="" />
                    <div id='block'></div>
        </div>
    );
}

export default Cart;
